\"shortDescription\":\"10 Animals That Were Scarier than Dinosaurs\\n\\nIf you're new, Subscribe!  http:\/\/goo.gl\/djmfuX\\n\\nTop 5 Best is the #1 place for all your heart warming stories about amazing people that will inspire you everyday. Make sure to subscribe and never miss a single video!\\n\\nNo one today can really get a full idea of what it was like to live surrounded by dinosaurs. While today we know that some animals like killer whales, alligators, lions and other big predators can be threatening to us humans, none of these can compare to the danger that dinosaurs and other prehistoric animals represented. Today well have a look at ten animals that were scarier than dinosaurs. Youll realize that dinosaurs were harmless and perhaps even friendly compared to the beasts Ill show you today. Ill also talk about some of the movies that fed us ideas of what these animals were like, and Ill compare those ideas to actual facts that will make you understand how real life creatures were in fact a bit scarier than what we see on the screen. Stay tuned all the way to number one and find out about an animal that youll be thankful to know its gone extinct. \\n\\n10. Arthropleura \\n\\nIm going to start with an animal that was not as big as a dinosaur. In fact, it wasnt even a carnivore! But Im sure youd be quite scared and probably a bit grossed out if you were to encounter it today. And Im pretty sure youd rather see a dinosaur instead of this animal. The Arthropleura was a millipede that could reach lengths of up to 2.5 meters, which means, if it were to stand on the lower end of its thousand feet, it would be higher than a christmas tree! The Arthropleura is known to be the largest invertebrate of all time. With such aspect, I doubt any predators wanted to mess with it.\\n\\n9. Dunkleosteus\\n\\nYikes! Even the name sounds scary already. If youre wondering what this animal looked like, let me start by pointing out that the Dunkleosteus was a fish! Of course, were not talking about a cute tropical fish or even a shark like the one from Jaws. This prehistoric fish was 33 feet long! Which means it was almost twice as long as the height of a giraffe from its head to its feet. However, what makes this animal threatening is not only its size, but also its sharp teeth. The bones in its jaw kept growing continuously, up until a point where their edges would become so sharp as they rubbed together against each other. These were useful tools to pierce and chew on their prey . This fish was as heavy as a hippopotamus and could easily snatch its prey in less than a second. \\n\\n8. Jaekelopterus\\n\\nThe Jaekelopterus was an aquatic arthropod. The best way to explain it is by pointing out that some people call it a Giant Sea Scorpion - can you picture that? If scorpions are scary already, I dont want to imagine what it would be like to come face to face with a giant one in the middle of the ocean! Its an experience that would definitely keep me away from the waters for good. The name Jaekelopterus comes from Otto Jaekel, a German paleontologist who was the first one to describe the species. Although its maximum size has not been confirmed, some experts believed the largest Jaekelopterus could have reached a length of 2.5 meters, making it taller than humans if it were to stand. This animal is believed to have lived in freshwater, making it a threat to other arthropods and smaller fish. Poor animals didnt stand a chance against this huge creature! \\n\\n7. Helicoprion\\n\\nAnd here is another fish on our list! Or...maybe not. One of the craziest facts about the helicoprion is that no one has been able to properly classify it and associate it to the animal groups we have today. We can say its a fish because it lived in the water, but paleontologists didnt have enough information to categorize it. Its teeth worked like a circular blade. Without any proper teeth in the upper jaw, this creature could gum you and bite you at the same time..quite scary and gross! The lower teeth were sharp, so its safe to assume that the helicoprion was a carnivore! What scientists cant figure out yet is whether it fed on small or big animals - they can only speculate as they still havent found any remains of a skull to properly figure out what its diet was. One thing is for sure, that odd looking jaw is more than enough to scare us all if we were to encounter it in the ocean today.\\n\\n\\nLeave a like for more shark tank, pawn stars, dr. phil, and other tv show business content. On Top 5 Best, we like to help you in mindset productivity, whether it's how to make more money videos, or going over the biggest mansions in the world, we show everything here! Make sure to subscribe for more amazing videos everyday!\\n\\nfamily friendly pg clean\\n\\n#viralstory #amazingpeople #top5best\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/eZOk_CSHfT8\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDG_U4Gcp6j0r9zCzQ4HbpK7fFrIw\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/eZOk_CSHfT8\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLA8OIv8Bn9DrgRk5w3pHzZS9BnGRw\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/eZOk_CSHfT8\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLAQC0h2bY8YbkumINluQ4vStRSLyQ\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/eZOk_CSHfT8\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLB31iHYSv3MdTXxfbOgxJ5m2OCi2w\",\"width\":336,\"height\":188}]},\"averageRating\":4.8204446,\"allowRatings\":true,\"viewCount\":\"7484942\",\"author\":\"Top 5 Best\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\":false},\"annotations\":[{\"playerAnnotationsExpandedRenderer\":{\"featuredChannel\":{\"startTimeMs\":\"5000\",\"endTimeMs\":\"661000 it was like to live surrounded by dinosaurs. While today we know that some animals like killer whales, alligators, lions and other big predators can be threatening to us humans, none of these can compare to the danger that dinosaurs and other prehistoric animals represented. Today well have a look at ten animals that were scarier than dinosaurs. Youll realize that dinosaurs were harmless and perhaps even friendly compared to the beasts Ill show you today. Ill also talk about some of the movies that fed us ideas of what these animals were like, and Ill compare those ideas to actual facts that will make you understand how real life creatures were in fact a bit scarier than what we see on the screen. Stay tuned all the way to number one and find out about an animal that youll be thankful to know its gone extinct. \n\n10. Arthropleura \n\nIm going to start with an animal that was not as big as a dinosaur. In fact, it wasnt even a carnivore! But Im sure youd be quite scared and probably a bit grossed out if you were to encounter it today. And Im pretty sure youd rather see a dinosaur instead of this animal. The Arthropleura was a millipede that could reach lengths of up to 2.5 meters, which means, if it were to stand on the lower end of its thousand feet, it would be higher than a christmas tree! The Arthropleura is known to be the largest invertebrate of all time. With such aspect, I doubt any predators wanted to mess with it.\n\n9. Dunkleosteus\n\nYikes! Even the name sounds scary already. If youre wondering what this animal looked like, let me start by pointing out that the Dunkleosteus was a fish! Of course, were not talking about a cute tropical fish or even a shark like the one from Jaws. This prehistoric fish was 33 feet long! Which means it was almost twice as long as the height of a giraffe from its head to its feet. However, what makes this animal threatening is not only its size, but also its sharp teeth. The bones in its jaw kept growing continuously, up until a point where their edges would become so sharp as they rubbed together against each other. These were useful tools to pierce and chew on their prey . This fish was as heavy as a hippopotamus and could easily snatch its prey in less than a second. \n\n8. Jaekelopterus\n\nThe Jaekelopterus was an aquatic arthropod. The best way to explain it is by pointing out that some people call it a Giant Sea Scorpion - can you picture that? If scorpions are scary already, I dont want to imagine what it would be like to come face to face with a giant one in the middle of the ocean! Its an experience that would definitely keep me away from the waters for good. The name Jaekelopterus comes from Otto Jaekel, a German paleontologist who was the first one to describe the species. Although its maximum size has not been confirmed, some experts believed the largest Jaekelopterus could have reached a length of 2.5 meters, making it taller than humans if it were to stand. This animal is believed to have lived in freshwater, making it a threat to other arthropods and smaller fish. Poor animals didnt stand a chance against this huge creature! \n\n7. Helicoprion\n\nAnd here is another fish on our list! Or...maybe not. One of the craziest facts about the helicoprion is that no one has been able to properly classify it and associate it to the animal groups we have today. We can say its a fish because it lived in the water, but paleontologists didnt have enough information to categorize it. Its teeth worked like a circular blade. Without any proper teeth in the upper jaw, this creature could gum you and bite you at the same time..quite scary and gross! The lower teeth were sharp, so its safe to assume that the helicoprion was a carnivore! What scientists cant figure out yet is whether it fed on small or big animals - they can only speculate as they still havent found any remains of a skull to properly figure out what its diet was. One thing is for sure, that odd looking jaw is more than enough to scare us all if we were to encounter it in the ocean today.\n\n\nLeave a like for more shark tank, pawn stars, dr. phil, and other tv show business content. On Top 5 Best, we like to help you in mindset productivity, whether it's how to make more money videos, or going over the biggest mansions in the world, we show everything here! Make sure to subscribe for more amazing videos everyday!\n\nfamily friendly pg clean\n\n"},{"text":"#viralstory","navigationEndpoint":{"clickTrackingParams":"CJEBENzXBCITCPX70PSqoOkCFZQTBgAdlcMJxw==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23viralstory","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#viralstory"}},"loggingDirectives":{"trackingParams":"CJEBENzXBCITCPX70PSqoOkCFZQTBgAdlcMJxw==","visibility":{"types":"12"}}},{"text":" "},{"text":"#amazingpeople","navigationEndpoint":{"clickTrackingParams":"CJABENzXBCITCPX70PSqoOkCFZQTBgAdlcMJxw==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23amazingpeople","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#amazingpeople"}},"loggingDirectives":{"trackingParams":"CJABENzXBCITCPX70PSqoOkCFZQTBgAdlcMJxw==","visibility":{"types":"12"}}},{"text":" "},{"text":"#top5best","navigationEndpoint":{"clickTrackingParams":"CI8BENzXBCITCPX70PSqoOkCFZQTBgAdlcMJxw==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23top5best","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#top5best"}},"loggingDirectives":{"trackingParams":"CI8BENzXBCITCPX70PSqoOkCFZQTBgAdlcMJxw==","visibility":{"types":"12"}}}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CI0BEJsrIhMI9fvQ9Kqg6QIVlBMGAB2VwwnH","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAnd e for all your heart warming stories about amazing people that will inspire you everyday. Make sure to subscribe and never miss a single video!\n\nNo one today can really get a full idea of what it was like to live surrounded by dinosaurs. While today we know that some animals like killer whales, alligators, lions and other big predators can be threatening to us humans, none of these can compare to the danger that dinosaurs and other prehistoric animals represented. Today well have a look at ten animals that were scarier than dinosaurs. Youll realize that dinosaurs were harmless and perhaps even friendly compared to the beasts Ill show you today. Ill also talk about some of the movies that fed us ideas of what these animals were like, and Ill compare those ideas to actual facts that will make you understand how real life creatures were in fact a bit scarier than what we see on the screen. Stay tuned all the way to number one and find out about an animal that youll be thankful to know its gone extinct. \n\n10. Arthropleura \n\nIm going to start with an animal that was not as big as a dinosaur. In fact, it wasnt even a carnivore! But Im sure youd be quite scared and probably a bit grossed out if you were to encounter it today. And Im pretty sure youd rather see a dinosaur instead of this animal. The Arthropleura was a millipede that could reach lengths of up to 2.5 meters, which means, if it were to stand on the lower end of its thousand feet, it would be higher than a christmas tree! The Arthropleura is known to be the largest invertebrate of all time. With such aspect, I doubt any predators wanted to mess with it.\n\n9. Dunkleosteus\n\nYikes! Even the name sounds scary already. If youre wondering what this animal looked like, let me start by pointing out that the Dunkleosteus was a fish! Of course, were not talking about a cute tropical fish or even a shark like the one from Jaws. This prehistoric fish was 33 feet long! Which means it was almost twice as long as the height of a giraffe from its head to its feet. However, what makes this animal threatening is not only its size, but also its sharp teeth. The bones in its jaw kept growing continuously, up until a point where their edges would become so sharp as they rubbed together against each other. These were useful tools to pierce and chew on their prey . This fish was as heavy as a hippopotamus and could easily snatch its prey in less than a second. \n\n8. Jaekelopterus\n\nThe Jaekelopterus was an aquatic arthropod. The best way to explain it is by pointing out that some people call it a Giant Sea Scorpion - can you picture that? If scorpions are scary already, I dont want to imagine what it would be like to come face to face with a giant one in the middle of the ocean! Its an experience that would definitely keep me away from the waters for good. The name Jaekelopterus comes from Otto Jaekel, a German paleontologist who was the first one to describe the species. Although its maximum size has not been confirmed, some experts believed the largest Jaekelopterus could have reached a length of 2.5 meters, making it taller than humans if it were to stand. This animal is believed to have lived in freshwater, making it a threat to other arthropods and smaller fish. Poor animals didnt stand a chance against this huge creature! \n\n7. Helicoprion\n\nAnd here is another fish on our list! Or...maybe not. One of the craziest facts about the helicoprion is that no one has been able to properly classify it and associate it to the animal groups we have today. We can say its a fish because it lived in the water, but paleontologists didnt have enough information to categorize it. Its teeth worked like a circular blade. Without any proper teeth in the upper jaw, this creature could gum you and bite you at the same time..quite scary and gross! The lower teeth were sharp, so its safe to assume that the helicoprion was a carnivore! What scientists cant figure out yet is whether it fed on small or big animals - they can only speculate as they still havent found any remains of a skull to properly figure out what its diet was. One thing is for sure, that odd looking jaw is more than enough to scare us all if we were to encounter it in the ocean today.\n\n\nLeave a like for more shark tank, pawn stars, dr. phil, and other tv show business content. On Top 5 Best, we like to help you in mindset productivity, whether it's how to make more money videos, or going over the biggest mansions in the world, we show everything here! Make sure to subscribe for more amazing videos everyday!\n\nfamily friendly pg clean\n\n#viralstory #amazingpeople #top5best","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/eZOk_CSHfT8/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDG_U4Gcp6j0r9zCzQ4HbpK7fFrIw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/eZOk_CSHfT8/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLA8OIv8Bn9DrgRk5w3pHzZS9BnGRw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/eZOk_CSHfT8/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAQC0h2bY8YbkumINluQ4vStRSLyQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/eZOk_CSHfT8/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLB31iHYSv3MdTXxfbOgxJ5m2OCi2w","width":336,"height":188}]},"useCipher":false,"averageRating":4.8204446,"allowRatings":true,"viewCount":"7484942","author":"Top 5 Best","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"5000","endTimeMs":"661000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/mvqviNx70U0l4ZcvUAXxhA/featured_channel.jpg?v=5c949efc","width":40,"height":40}]},"trackingParams":"CAwQ8zciEwjS5dD0qqDpAhUa6OYKHX7HA88=","navigationEndpoint":{"clickTrackingParams":"CAwQ8zciEwj eura was a millipede that could reach lengths of up to 2.5 meters, which means, if it were to stand on the lower end of its thousand feet, it would be higher than a christmas tree! The Arthropleura is known to be the largest invertebrate of all time. With such aspect, I doubt any predators wanted to mess with it.\n\n9. Dunkleosteus\n\nYikes! Even the name sounds scary already. If youre wondering what this animal looked like, let me start by pointing out that the Dunkleosteus was a fish! Of course, were not talking about a cute tropical fish or even a shark like the one from Jaws. This prehistoric fish was 33 feet long! Which means it was almost twice as long as the height of a giraffe from its head to its feet. However, what makes this animal threatening is not only its size, but also its sharp teeth. The bones in its jaw kept growing continuously, up until a point where their edges would become so sharp as they rubbed together against each other. These were useful tools to pierce and chew on their prey . This fish was as heavy as a hippopotamus and could easily snatch its prey in less than a second. \n\n8. Jaekelopterus\n\nThe Jaekelopterus was an aquatic arthropod. The best way to explain it is by pointing out that some people call it a Giant Sea Scorpion - can you picture that? If scorpions are scary already, I dont want to imagine what it would be like to come face to face with a giant one in the middle of the ocean! Its an experience that would definitely keep me away from the waters for good. The name Jaekelopterus comes from Otto Jaekel, a German paleontologist who was the first one to describe the species. Although its maximum size has not been confirmed, some experts believed the largest Jaekelopterus could have reached a length of 2.5 meters, making it taller than humans if it were to stand. This animal is believed to have lived in freshwater, making it a threat to other arthropods and smaller fish. Poor animals didnt stand a chance against this huge creature! \n\n7. Helicoprion\n\nAnd here is another fish on our list! Or...maybe not. One of the craziest facts about the helicoprion is that no one has been able to properly classify it and associate it to the animal groups we have today. We can say its a fish because it lived in the water, but paleontologists didnt have enough information to categorize it. Its teeth worked like a circular blade. Without any proper teeth in the upper jaw, this creature could gum you and bite you at the same time..quite scary and gross! The lower teeth were sharp, so its safe to assume that the helicoprion was a carnivore! What scientists cant figure out yet is whether it fed on small or big animals - they can only speculate as they still havent found any remains of a skull to properly figure out what its diet was. One thing is for sure, that odd looking jaw is more than enough to scare us all if we were to encounter it in the ocean today.\n\n\nLeave a like for more shark tank, pawn stars, dr. phil, and other tv show business content. On Top 5 Best, we like to help you in mindset productivity, whether it's how to make more money videos, or going over the biggest mansions in the world, we show everything here! Make sure to subscribe for more amazing videos everyday!\n\nfamily friendly pg clean\n\n#viralstory #amazingpeople #top5best"},"lengthSeconds":"682","ownerProfileUrl":"http://www.youtube.com/channel/UCmvqviNx70U0l4ZcvUAXxhA","externalChannelId":"UCmvqviNx70U0l4ZcvUAXxhA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM"
